import React from 'react';
import { useLocation } from 'react-router-dom';
import {
	BookedContainer,
	BookedDetails,
	BookedDetailsWrapper,
	BookedList,
	BookedListItem,
	BookedWrapper,
} from './landing.styles';
import Titanic from '../../assets/Titanic.gif';

const LandingPage = () => {
	const location = useLocation();
	console.log(location.state.details);
	return (
		<div className="main">
			<BookedContainer>
				<BookedWrapper>
					<img src={Titanic} alt="Nice gif!" style={{ margin: '10px' }} />
					<h2>Deine Buchung wurde bestätigt! ⚓</h2>
					<BookedDetails>Details:</BookedDetails>
					{location.state ? (
						<React.Fragment>
							<BookedDetailsWrapper>
								<BookedListItem>
									<BookedList className="border padding">Name</BookedList>
									<BookedList className="border padding">{location.state.details.name}</BookedList>
								</BookedListItem>
								<BookedListItem>
									<BookedList className="border padding">Email</BookedList>
									<BookedList className="border padding">{location.state.details.email}</BookedList>
								</BookedListItem>
								<BookedListItem>
									<BookedList>Personen</BookedList>
									<BookedList>{location.state.details.person}</BookedList>
								</BookedListItem>
								<BookedListItem>
									<BookedList>Von</BookedList>
									<BookedList>
										{location.state.details.arrivalDate.getDate()}.
										{location.state.details.arrivalDate.getMonth() + 1}.
										{location.state.details.arrivalDate.getFullYear()}
									</BookedList>
								</BookedListItem>
								<BookedListItem>
									<BookedList>Bis</BookedList>
									<BookedList>
										{location.state.details.departureDate.getDate()}.
										{location.state.details.departureDate.getMonth() + 1}.
										{location.state.details.departureDate.getFullYear()}
									</BookedList>
								</BookedListItem>
							</BookedDetailsWrapper>
						</React.Fragment>
					) : null}
				</BookedWrapper>
			</BookedContainer>
		</div>
	);
};

export default LandingPage;
